import React, { Component } from 'react';
import '../../scss/Works.scss';
import ScrollAnimation from 'react-animate-on-scroll';
import ChipsHTML from './Chips/ChipsHTML';
import ChipsSASS from './Chips/ChipsSASS';
import ChipsBootstrap from './Chips/ChipsBootstrap';
import ChipsJavascript from './Chips/ChipsJavascript';

const Style = {
    Display: {
        display: 'none'
    }
};

export default class Works extends Component {
    render() {
        return (
            <article className="Works" id="myWorks">
                <a className="caseOne" href="https://chrisdemey.github.io/restaurant-css-framework/" rel="noopener">
                    <ScrollAnimation animateIn="bounceInLeft">
                        <div className="imageOne">
                            <ChipsHTML style={Style.Display}/>
                            <ChipsSASS />
                            <ChipsBootstrap />
                        </div>
                    </ScrollAnimation>
                </a>
                <a className="caseTwo" href="https://chrisdemey.github.io/TD2-cssgrid/" rel="noopener">
                    <ScrollAnimation animateIn="bounceInRight">
                        <div className="imageTwo">
                            <ChipsHTML />
                            <ChipsSASS />
                        </div>
                    </ScrollAnimation>
                </a>
                <a className="caseThree" href="https://cleobuck.github.io/allezcinev3/" rel="noopener">
                    <ScrollAnimation animateIn="bounceInLeft">
                        <div className="imageThree">
                            <ChipsHTML />
                            <ChipsSASS />
                            <ChipsBootstrap />
                            <ChipsJavascript />
                        </div>
                    </ScrollAnimation>
                </a>
                <a className="caseFour" href="https://chrisdemey.github.io/Hitman2-website/" rel="noopener">
                    <ScrollAnimation animateIn="bounceInRight">
                        <div className="imageFour">
                            <ChipsHTML />
                            <ChipsSASS />
                            <ChipsBootstrap />
                            <ChipsJavascript />
                        </div>
                    </ScrollAnimation>
                </a>
                <ScrollAnimation animateIn="wobble" initiallyVisible={true}>
                    <p>Cette section sera régulièrement mise à jour</p>
                </ScrollAnimation>
            </article>
        );
    }
}
